room.onPlayerJoin = function(player) {
  atualizarAdmins();
  kickJogadoresComNomeIgual(player);
  room.sendAnnouncement("Bem vindo!", player.id, COLOR.GREEN, "bold", 2);
  room.sendAnnouncement("Digite !ajuda", player.id, COLOR.GREEN, "bold", 2);

  console.log('+-----------------------------------------------------------------------------');
  console.log('| Nome: ' + player.name);
  console.log('| Auth: ' + player.auth);
  console.log('+-----------------------------------------------------------------------------');
}

room.onPlayerLeave = function(player) {
  atualizarAdmins();
}

room.onPlayerChat = function(player, message) {
let spacePos = message.search(" ");
let command = message.substr(0, spacePos !== -1 ? spacePos : message.length);
if (commands.hasOwnProperty(command) == true) return commands[command](player, message);

// !sair, !bb, !exit, !quit, !leave and !ggs
if (array_mensagemSair.includes(message)) {
  room.kickPlayer(player.id, 'Decidiu sair da sala.', false);
}

// !ajuda or !help
if (array_mensagemAjuda.includes(message)) {
  room.sendAnnouncement("> Comandos: " + variavel_comandosPublicos, player.id, COLOR.GREEN, "bold", 2);
  if(array_superAdmins_nicks.includes(player.name)){
  room.sendAnnouncement("> Comandos: " + variavel_comandosPrivados, player.id, COLOR.GREEN, "bold", 2);
  }
  return false;
}

// !admin password
if (message.substr(0, 7) == '!admin ') {
  if (array_superAdmins_nicks.includes(player.name) == true) {
    variavel_superAdmin_senha = message.substr(7);
  room.setPlayerAdmin(player.id, true);
  room.sendAnnouncement("> Super-Admin concedido.", player.id, COLOR.GREEN, "bold", 2);
  return false;
  }
  else {
  room.sendAnnouncement("> Você não tem permissão para executar esse comando.", player.id, COLOR.RED, "bold", 2);
  return false;
  }
}
  
}
